#include <CAN.h>

void setup() {
  Serial.begin(9600);
  while (!Serial);

  Serial.println("CAN Sender");

  CAN.setPins(10, 3);
  
  // start the CAN bus at 500 kbps
  //if (!CAN.begin(500E3)) {
  if (!CAN.begin(500E3)) {
    Serial.println("Starting CAN failed!");
    while (1);
  }
}

void loop() {
  // send packet: id is 11 bits, packet can contain up to 8 bytes of data
  Serial.print("Sending packet ... ");

  CAN.beginPacket(0x572);
  CAN.write(0b1); // Fehlerspeichereintrag__ZAS_
  CAN.write(0b1); // Frei_ZAS_1_3
  CAN.write(0b1); // Frei_ZAS_1_2
  CAN.write(0b1); // Klemme_15_SV
  CAN.write(0b1); // Frei_ZAS_1_1
  CAN.write(0b1); // Klemme_P__Parklichtstellung_
  CAN.write(0b1); // Klemme_50__Starten_
  CAN.write(0b1); // Klemme_X__Startvorgang_
  CAN.write(0b1); // Klemme_15__Z_ndung_ein_
  CAN.write(0b1); // S_Kontakt__Schl_ssel_steckt_

  CAN.endPacket();

  Serial.println("done");

  delay(1000);
}

#include <bits/stdc++.h>

using namespace std;

#define For(i, n)           for(int i = 0; i < n; ++i)
#define all(x)              (x).begin(),(x).end()
#define rall(x)             (x).rbegin(),(x).rend()
#define ls(x)               x+x+1
#define rs(x)               x+x+2
#define endl                '\n'

#define ld                  long double
#define pii                 pair<int, int>
#define vt                  vector
#define ll                  long long

#define sim template < class c
#define ris return * this
#define dor > debug & operator <<
#define eni(x) sim > typename \
enable_if<sizeof dud<c>(0) x 1, debug&>::type operator<<(c i) {
sim > struct rge { c b, e; };
sim > rge<c> range(c i, c j) { return rge<c>{i, j}; }
sim > auto dud(c* x) -> decltype(cerr << *x, 0);
sim > char dud(...);
#define LOCAL
struct debug {
#ifdef LOCAL
~debug() { cerr << endl; }
eni(!=) cerr << boolalpha << i; ris; }
eni(==) ris << range(begin(i), end(i)); }
sim, class b dor(pair < b, c > d) {
ris << "(" << d.first << ", " << d.second << ")";
}
sim dor(rge<c> d) {
*this << "[";
for (auto it = d.b; it != d.e; ++it)
    *this << ", " + 2 * (it == d.b) << *it;
ris << "]";
}
#else
sim dor(const c&) { ris; }
#endif
};
#define imie(...) " [" << #__VA_ARGS__ ": " << (__VA_ARGS__) << "] "

template<typename T>
void read(vt<T> & a) {For(i, a.size()) cin >> a[i];}
template<typename T>
void read2(vt<vt<T> > & a) {For(i, a.size()) read(a[i]);}
template<typename T>
void print(vt<T> & a) {For(i, a.size()) cout << a[i] << " "; cout << endl;}
template<typename T>
void print2(vt<vt<T> > & a) {For(i, a.size()) print(a[i]);}

const int MAX = 1e9;
const int MOD = 1e9+7;
const ll  INF = 1e18;
const ld  PI  = 3.14159265358979323846;

void solve() {
    int n; cin >> n;
    string s; cin >> s;
    ll full_size = 0;
    For(i, n) {
        if (s[i] == '.') full_size = (full_size << 1) % MOD;
        else full_size = (full_size + 1) % MOD;
    }
    int first = -1, first_in_s = -1, last = -1, last_in_s = -1;
    ll size = 0, pref_add = 0, pref_cnt = 0, pref_add_range = 0;
    ll ans = 0;
    for (int i = 0; i < n; i++) {
        if (s[i] == '.') {
            ll add_duplicated = (ans - pref_add * size % MOD + MOD + (pref_add_range - pref_cnt * size % MOD + MOD) * size % MOD) % MOD;
            pref_add_range = (pref_add_range + (pref_add_range - pref_cnt * size % MOD + MOD) % MOD) % MOD;
            pref_add = (pref_add + (pref_add + size * pref_cnt)) % MOD;
            pref_cnt = (pref_cnt << 1) % MOD;
            ans = (ans + add_duplicated) % MOD;
            if (pref_add != 0 && s[last_in_s] != s[first_in_s]) {
                ll add_range = (full_size - (size + first - 1 + MOD) % MOD + MOD) % MOD;
                pref_cnt = (pref_cnt + 1) % MOD;
                pref_add = (pref_add + last) % MOD;
                pref_add_range = (pref_add_range + add_range) % MOD;
                ans = (ans + last * add_range) % MOD;
            }
            last = (last + size) % MOD;
            size = (size << 1) % MOD;
        } else if (s[i] == 'O' || s[i] == 'X') {
            if (last_in_s != -1) {
                if (s[i] != s[last_in_s]) {
                    ll add_range = (full_size - size + MOD) % MOD;
                    pref_cnt = (pref_cnt + 1) % MOD;
                    pref_add = (pref_add + last) % MOD;
                    pref_add_range = (pref_add_range + add_range) % MOD;
                    ans = (ans + last * add_range) % MOD;
                }
            }
            size = (size + 1) % MOD;
            last = size, last_in_s = i;
            if (first_in_s == -1) {
                first = size, first_in_s = i;
            }
        } else size++;
    }
    cout << ans << endl;
}

// THE SOLUTION IS ALWAYS SIMPLE
// THE CODE IS ALWAYS SHORT

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0); cout.tie(0);
#ifdef DEBUG
    freopen("output.txt", "w", stdout);
    freopen("input.txt", "r", stdin);
#endif
    int T = 1;
    cin >> T;
    For(t, T) {
        cout << "Case #" << t + 1 << ": ";
        solve();
    }
    return 0;
}

//This is a Java program.
//It sorts the list of your things specified by name.
//This code was written in the JGrasp compiler.
//Have the text file in the same directory as this file.
//The file that you input must exist and its name match
//it with the format extension.
//For example, if you have a text file
//called "BookList," you must input it as BookList.txt.
//In the file, each item must be written on each line like this:

//The Great Gatsby
//A Streetcar Named Desire (without the double slashes [//])

import java.util.*;
import java.io.*;

public class SortAListFromFile{
   public static void main(String [] args){
   List<String> media = new ArrayList<String>();
   try{
   Scanner console = new Scanner(System.in);
   System.out.println("What is your text file to sort called?");
   String fileName = console.nextLine();
   Scanner textConsole = new Scanner(new File(fileName));
   while(textConsole.hasNextLine()){media.add(textConsole.nextLine());};
   console.close();
   textConsole.close();
   }
   catch (FileNotFoundException e) {
      System.out.println("An error occurred.");
      e.printStackTrace();
   }
   Collections.sort(media);
   System.out.println("The sorted order is: ");
   for(var iterator : media) System.out.println(iterator);
   }
}

